import { connect } from 'react-redux'
import { Link } from 'react-router-dom'
import './Navbar.css'
import React, { Component } from 'react';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import CartD from './CartDialog'
import { Button, ToastContainer, toast } from 'mdbreact';



class Navbar extends Component {
  notify(type){
    return () => {
      switch (type) {
        case 'info':
          toast.info('Info message', {
            autoClose: 3000
          });
          break;
        case 'success':
          toast.success('Success message', {
            position: "top-right",
          });
          break;
        case 'warning':
          toast.warn('Warning message');
          break;
        case 'error':
          toast.error('Error message');
          break;
      }
    };
  };
  state = {
    open: false,
  };
  handleClickOpen = () => {
    if(this.props.items.length >0){
      this.setState({ open: true });
    }else{
      
            
    }
  };
  
  handleClose = () => {
    this.setState({ open: false });
  };
  handleCheckout = () => {
    this.setState({ open: false });
  };

    render() {
        let itemList = this.props.items;
        console.log(itemList);
        return(
            <div className="NavBar ">
            <nav class="navbar navbar-expand-lg navbar-light px-5 gb-white">
            <Link class="navbar-brand" to="/" style={{fontSize : "40px"}}>{this.props.CompanyName}</Link>
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse " id="navbarSupportedContent">
            <ul class="navbar-nav ml-auto">
            <li class="nav-item">
            <Link to="/menu" style={{fontSize : "20px"}} class= "nav-link">Menu</Link>
            </li>
            <li class="nav-item">
              <Link class="nav-link" to="/blog" style={{fontSize : "20px"}}>Blog</Link>
            </li>
            <li class="nav-item">
              <Link to="login" class= "nav-link" style={{fontSize : "20px"}}>Login</Link>
            </li>
            <li class="nav-item">
            <button onClick={this.handleClickOpen} className="CartB">
            <div id ='test'>
            <span id="numberOfItemsAdded">{itemList.length}</span>
            <i class="fas fa-box-open shoppingChart" style={{fontSize : "20px"}}></i>
            </div>
            </button>
            </li>
            
          </ul>
            </div>
            </nav>
            <Dialog
          open={this.state.open}
          onClose={this.handleClose}
          aria-labelledby="alert-dialog-title"
          aria-describedby="alert-dialog-description"
        >
          <DialogTitle id="alert-dialog-title">{"Cart"}</DialogTitle>
          <DialogContent>
            <DialogContentText id="alert-dialog-description">
            </DialogContentText>
            <CartD/>

          </DialogContent>
          <DialogActions>
            <button onClick={this.handleClose} className="btn btn-secondary ActionButton">
              Continue
            </button>
            <Link to= "/cart" onClick={this.handleCheckout} className="btn btn-secondary ActionButton">
              Checkout
            </Link>
          </DialogActions>
        </Dialog>
        <ToastContainer
          hideProgressBar={true}
          newestOnTop={true}
          autoClose={5000}
        />
            </div>
        )
    }
}

const mapStateToProps = (state)=>{
    return{
        items: state.addedItems,
        //addedItems: state.addedItems
    }
}

export default connect(mapStateToProps)(Navbar)
